def react(reaction):
    for i in range(0, len(reaction)):
    # If the strings aren't the same, but if we capitalize one of them they are, 
    # the characters are the same but lowercase and uppercase.
        try: # Ignore IndexEror
            if reaction[i] != reaction[i + 1] and (reaction[i].upper() == reaction[i + 1] or reaction[i] == reaction[i + 1].upper()):
                # Remove i and i + 1 chars
                if i == 0:
                    reaction = reaction[i + 2:len(reaction)]
                elif i + 2 == len(reaction):
                    reaction = reaction[0:i]
                else:
                    reaction = reaction[0:i] + reaction[i + 2:len(reaction)]
        except IndexError:
            break
    return reaction

entry = ""

reaction = input(">Type the reaction string. For challenge entry, type 'challenge': ")
if reaction == "challenge":
    reaction = entry
og_react = reaction
reaction_changed = True
while reaction_changed == True:
    reacted = react(reaction)
    if reacted == reaction:
        reaction_changed = False
    reaction = reacted
print(">The length of the polymer is: " + str(len(reaction)))   
# PART 2: We try to react removing all 26 letters
# Char 97 is lowercase a, 98 lowercase b and so on
# Difference between uppercase and lowercase chars is 32
# NOTE: Might take a bit!
reaction = og_react
shortest_len = len(reaction)
for i in range(97, 97 + 26):
    reacted = reaction.replace(chr(i), "") # Lowercase
    reacted = reacted.replace(chr(i - 32), "") # Uppercase
    reaction_changed = True
    while reaction_changed == True:
        reacted_new = react(reacted)
        if reacted == reacted_new:
            reaction_changed = False
        reacted = reacted_new
    if len(reacted) < shortest_len:
        shortest_len = len(reacted)
print(">The shortest polymer you can form removing one char has a length of: " + str(shortest_len))